USE demo_porte_ouverte_techno;

TRUNCATE TABLE Categorie;
create table if not exists Categorie(
	IdCategorie int NOT NULL,
	Libelle varchar(250) NOT NULL,
 CONSTRAINT PK_Categorie PRIMARY KEY 
(
	IdCategorie ASC
));

TRUNCATE TABLE Entreprise;
create table if not exists Entreprise(
	IdEnt int NOT NULL,
	Nom varchar(50) NOT NULL,
	Rue varchar(50) NOT NULL,
	Numero int NOT NULL,
	CodePostal varchar(5) NOT NULL,
	Ville varchar(50) NOT NULL,
 CONSTRAINT PK_Entreprise PRIMARY KEY CLUSTERED 
(
	IdEnt ASC
));

TRUNCATE TABLE Evenement;
create table if not exists Evenement(
	IdEvent int NOT NULL,
	DateDebutEvent datetime NOT NULL,
	DateFinEvent datetime NOT NULL,
	Titre varchar(50) NOT NULL,
	Description varchar(250) NOT NULL,
	IdCategorie int NOT NULL,
	Prix float NOT NULL,
 CONSTRAINT PK_Evenements PRIMARY KEY CLUSTERED 
(
	IdEvent ASC
));


TRUNCATE TABLE EventEntreprise;
create table if not exists EventEntreprise(
	IdEvent int NOT NULL,
	IdEnt int NOT NULL,
 CONSTRAINT PK_EventEntreprise PRIMARY KEY CLUSTERED 
(
	IdEvent ASC,
	IdEnt ASC
));

TRUNCATE TABLE Inscription;
create table if not exists Inscription(
	IdInscription int NOT NULL,
	IdEvent int NOT NULL,
	Nom varchar(50) NOT NULL,
	Prenom varchar(50) NOT NULL,
	Confirme bit NOT NULL,
	Email varchar(365) NOT NULL,
 CONSTRAINT PK_Inscriptions PRIMARY KEY CLUSTERED 
(
	IdInscription ASC
));






ALTER TABLE Inscription ALTER Confirm SET DEFAULT 0;

ALTER TABLE Evenement 
ADD CONSTRAINT FK_Evenement_Categorie 
FOREIGN KEY (IdCategorie) 
REFERENCES Categorie(IdCategorie);



ALTER TABLE EventEntreprise 
ADD CONSTRAINT FK_EventEntreprise_Entreprise 
FOREIGN KEY (IdEnt) 
REFERENCES Entreprise(IdEnt);



ALTER TABLE EventEntreprise 
ADD CONSTRAINT FK_EventEntreprise_Evenement 
FOREIGN KEY (IdEvent) 
REFERENCES Evenement(IdEvent);




ALTER TABLE Inscription 
ADD CONSTRAINT FK_Inscription_Evenement 
FOREIGN KEY (IdEvent) 
REFERENCES Evenement(IdEvent);